values:
&nbsp;OK, so I lied in that last post...I'm a little late.

Considering the chaos I'm anticipating within the next few weeks, I'm actually in a very good mood today.&nbsp;&nbsp;

Had a fairly decent weekend.&nbsp; Friday, I was out of the office to&nbsp;present fall buys&nbsp;to a client.&nbsp; Luckily, the client was really busy and didn't have time for 100 questions afterward, so I got to start my weekend early.&nbsp; Home by 3pm on a Friday is always good!&nbsp;&nbsp;

Adam had to work Saturday so I&nbsp;did some cleaning, ran errands and made it over to Indigo for a couple of hours while he was at work.&nbsp; I picked up 2 new books: Choke (Chuck Palahniuk) and Lamb (Christopher Moore).&nbsp;&nbsp;I don't know which one I'll read first&nbsp;???&nbsp;&nbsp;Adam didn't get&nbsp;in until after 11pm, but we had a really nice&nbsp;dinner together when he got home.&nbsp; Followed dinner up with a few drinks and a joint before crashing infront of the TV.&nbsp;

Sunday we got to sleep in.&nbsp; And by sleeping in, I mean past 9am.&nbsp; I think it was almost 10:30am when we got up - which is really late for us these days.&nbsp; We had a huge list of things to do but we said fuck it and decided to go shopping instead!&nbsp; We found this new smoke shop downtown.&nbsp; I think it was called Tobac, or something.&nbsp; They had a good selection and their prices are way better than Friendly Stranger.&nbsp; So, we bought a hookah.&nbsp; I've wanted one for ages now.&nbsp;&nbsp;We used&nbsp;the hookah&nbsp;for at least 2 hours last night. Mmmm!&nbsp; I haven't tried smoking weed in it yet...maybe next weekend at the UFC party.

Big TV week ahead....

Big Brother 8 Finale on Tuesday - Go Dick!!!&nbsp;or Daniele!!!
Last&nbsp;female Inferno on R.W.R.R. Challenge:Inferno 3 on Tuesday too!&nbsp;&nbsp;&nbsp;&nbsp; Nobody call me on Tuesday! ;p&nbsp;&nbsp;

I'm thinking I'll post my entries as public now...I don't know why I ever used to post friends only anyways.
'Till next time...take er easy!
